import React, { Component } from "react";
import "./DetailImages.scss";
class DetailImages extends Component {
  constructor() {
    super();
    this.state = {
      detailImage: [],
    };
  }

  componentDidMount() {
    fetch("/Data/itemDetail/DetailData.json", {
      method: "GET",
    })
      .then((res) => res.json())
      .then((result) => {
        this.setState({ detailImage: result.image });
      });
  }

  render() {
    const { detailImage } = this.state;
    return (
      <section className="DetailImages">
        <ul className="imageList">
          {detailImage.map((el, index) => (
            <li key={index}>
              <img alt="detailItemImage" src={el} />
            </li>
          ))}
        </ul>
      </section>
    );
  }
}

export default DetailImages;
